import React from "react";

export const Header = () => {
  return (
    <div className="py-5 px-10 w-full">
      <div className="flex">
        <input
          type="text"
          placeholder="Add new item..."
          className="py-3 px-3 rounded-full bg-gray-100 w-96 font-extrabold text-xl focus:outline-none text-gray-600"
        />
        <button className="ml-5 text-gray-400 bg-gray-100 px-4 rounded-xl text-4xl hover:text-gray-600 hover:bg-gray-300 transition duration-300 focus:outline-none">
          +
        </button>
      </div>
      <div>
        <img
          src="https://emojipedia-us.s3.dualstack.us-west-1.amazonaws.com/thumbs/240/apple/271/full-moon_1f315.png"
          alt="full-moon-emoji"
        />
      </div>
    </div>
  );
};
